use configs;

DROP TABLE IF EXISTS `client_segmentproperties`;
CREATE TABLE `client_segmentproperties` (
  `ispermeable` int(11) NOT NULL,
  `clientname` varchar(100) NOT NULL,
  `entryapproval` int(11) NOT NULL,
  `exitapproval` int(11) NOT NULL,
